import { useEffect, useState } from "react";
import { Link } from 'react-router-dom';

const Movies = () => {
  const [movies, setMovies] = 
    useState([{ title: "Titanic", releaseDate: "1997", rating: 7.8 }]);

  useEffect(() => {
    // fetch movie data or update tdhe state with props passed down from parent component
  }, []);

  return(
    <div>
      <h2>Movies</h2>
      <hr />
      <table className="table table-striped table-hover">
        <thead>
          <tr>
            <th>Movie</th>
            <th>Release Date</th>
            <th>Rating</th>
          </tr>
        </thead>
        <tbody>
          {movies.map(movie => (
            <tr key={movie.title}>
              <td>{movie.title}</td>
              <td>{movie.releaseDate}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  )
}

export default Movies;
